import React from "react";
import { Typography } from "@material-ui/core";

import { makeStyles } from "@material-ui/core/styles";

const styles = makeStyles({
  wrapper: {
    display: "flex",
    flexDirection: "column",
    alignment: "center",
    padding: "0 5rem 0 5rem",
  },
  item: {
    padingTop: "1rem",
  },
});

export default function Grid(props) {
  const { icon1,icon2,icon3, title1,title2,title3, hours1,hours2,hours3 } = props;
  const classes = styles();
  return (
    <div className={classes.wrapper}>
      <div>
      <div className={classes.item}>{icon1}</div>
      <Typography className={classes.item}>{title1}</Typography>
      <div className={classes.item}>
        <hr />
      </div>
      <Typography className={classes.item}>{hours1}</Typography>
      </div>

      <div>
      <div className={classes.item}>{icon2}</div>
      <Typography className={classes.item}>{title}</Typography>
      <div className={classes.item}>
        <hr />
      </div>
      <Typography className={classes.item}>{hours}</Typography>
      </div>

      <div>
      <div className={classes.item}>{icon}</div>
      <Typography className={classes.item}>{title}</Typography>
      <div className={classes.item}>
        <hr />
      </div>
      <Typography className={classes.item}>{hours}</Typography>
      </div>

    </div>
  );
}
